import React, { useState } from "react";
import { collection, query, where, getDocs } from "firebase/firestore";
import { db } from "../init-firebase";
import Swal from "sweetalert2";
import '../styles/home.css'
const DonersData = () => {
  const [city, setCity] = useState("");
  const [bloodGroup, setBloodGroup] = useState("");
  const [doners, setDonors] = useState([]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate the inputs
    if (!bloodGroup) {
      Swal.fire("Please add both city and blood group");
      return;
    }

    try {
      const filters = [];
      if (bloodGroup) {
        filters.push(where("DonerBloodGroup", "==", bloodGroup));
      }
      if (city) {
        filters.push(where("CityName", "==", city));
      }

      const matchData = query(collection(db, "BloodDoners"), ...filters);
      const querySnapshot = await getDocs(matchData);

      const matchedDonors = querySnapshot.docs.map((doc) => ({
        id: doc.id,
        DonerName: doc.data().DonerName,
        DonerBloodGroup: doc.data().DonerBloodGroup,
        CityName: doc.data().CityName,
        ContactNo: doc.data().ContactNo,
      }));

      if (matchedDonors.length === 0) {
        Swal.fire("No donors found matching your criteria.");
      } else {
        setDonors(matchedDonors);
      }
    } catch (error) {
      console.error("Error fetching donors:", error);
      Swal.fire("Error", "Failed to fetch data", "error");
    }
  };

  return (
    <div className="contact-us-container">
       <div className="navbar-links">
          <a href="/home">Home</a>
           <a href="/profile">Profile</a>           
           <button>Logout</button>
         <a href="/doner">Doner's</a>
         </div>
    <h2 className="text-2xl font-bold mb-4 text-center">Find Blood Donors</h2>
    <form onSubmit={handleSubmit} className="space-y-4 max-w-lg mx-auto">
      <div>
        <label className="block text-gray-700 font-medium">City</label>
        <input
          type="text"
          className="w-full border border-gray-300 rounded-lg px-4 py-2 text-sm"
          placeholder="Enter your city"
          value={city}
          onChange={(e) => setCity(e.target.value)}
          required
       disab  />
      </div>
      <div>
        <label className="block text-gray-700 font-medium">Blood Group</label>
        <input
          type="text"
          className="w-full border border-gray-300 rounded-lg px-4 py-2 text-sm"
          placeholder="Enter blood group (e.g., A+, O-)"
          value={bloodGroup}
          onChange={(e) => setBloodGroup(e.target.value)}
          required
        />
      </div>
      <button
        type="submit"
        className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600 w-full"
      >
        Search
      </button>
    </form>
  
    <div className="mt-6 max-w-lg mx-auto">
      {doners.length > 0 ? (
        <div>
          <h3 className="text-lg font-bold">Matching Results:</h3>
          <ul className="mt-4 space-y-4">
            {doners.map((donor, index) => (
              <li
                key={index}
                className="p-4 border border-gray-300 rounded-lg shadow-md text-center"
              >
                <p>
                  <strong>Name:</strong> {donor.DonerName}
                </p>
                <p>
                  <strong>City:</strong> {donor.CityName}
                </p>
                <p>
                  <strong>Blood Group:</strong> {donor.DonerBloodGroup}
                </p>
                <p>
                  <strong>Contact:</strong> {donor.ContactNo}
                </p>
              </li>
            ))}
          </ul>
        </div>
      ) : (
        <p className="text-gray-600 mt-4 text-center">No results to display.</p>
      )}
    </div>
  </div>
  
  );
};

export default DonersData;
